My Sisters Hot Friend - Maci Winslett
Added: October 27, 2014

Maci Winslett stops by her friends house to borrow a dress. Her friend's brother, Kris, has a second dress for Maci to try on. It's a lot more revealing and Maci isn't too sure about wearing it out for drinks. That's when Kris convinces her that it would be a better idea for her to stay home with him and bang his brains out instead
